export async function sendMessage(t){const e=new FormData(t),n=Object.fromEntries(e),s=JSON.stringify(n);return new Promise(((e,n)=>{fetch(t.action,{method:t.method,headers:{"Content-Type":"application/json; charset=UTF-8",Accept:"application/json"},body:s}).then((async t=>{const s=await t.json();200===t.status&&s?.success?e(s):n(s||t)})).catch((t=>{n(t)}))}))}